import React from "react";
import { Link } from "react-router-dom";
import instagramImage from './instagram.jpeg'; 
import tiktokImage from './tictok.png';
import whatsappImage from './images/whatsapp.png';
import './footer.css';

function Footer() {
    return (
        <footer className="footer">
            <div className="footer-content">
                {/* Quick Links Section */}
                <div className="footer-section">
                    <h5 className="footer-title">Quick Links</h5>
                    <div className="footer-links">
                        <div><Link to="/" className="footer-link">Home</Link></div>
                        <div><Link to="/product" className="footer-link">Product</Link></div>
                        <div><Link to="/review" className="footer-link">Review</Link></div>
                        <div><Link to="/wishlist" className="footer-link">Wishlist</Link></div>
                        <div><Link to="/create-account" className="footer-link">Create Account</Link></div>
                        <div><Link to="/order" className="footer-link">Order</Link></div>
                    </div>
                </div>
                
                {/* Social Media Section */}
                <div className="footer-section">
                    <h5 className="footer-title">Social Media</h5>
                    <div className="footer-icons">
                        <a href="https://www.instagram.com/fierce_256" className="footer-icon-link">
                            <img src={instagramImage} alt="Instagram" className="footer-icon-img" />
                        </a>
                        <a href="https://www.tiktok.com/@fierce_256" className="footer-icon-link">
                            <img src={tiktokImage} alt="TikTok" className="footer-icon-img" />
                        </a>
                        <a href="https://wa.me/256753031602" className="footer-icon-link">
                            <img src={whatsappImage} alt="WhatsApp" className="footer-icon-img" />
                        </a>
                    </div>
                </div>
            </div>
            <div className="footer-info">
                <small className="text-muted">Last updated 3 mins ago</small>
            </div>
        </footer>
    );
}

export default Footer;
